import React from 'react';
import Carousel from 'react-material-ui-carousel';
import MuiGrid from '@material-ui/core/Grid';
import { Paper } from '@material-ui/core';
import Styles from './Styles';
import { CAROUSEL_ITEMS } from './Constants';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import styled from '@material-ui/styles/styled';
import { useIntl } from 'react-intl';
import {
  compose as composeStyles,
  palette,
  sizing,
  spacing,
} from '@material-ui/system';
import Nana from '../../assets/images/nana.jpeg';
const Grid = styled(MuiGrid)(composeStyles(spacing, palette, sizing));

interface Props {
  /**
   * Injected by the documentation to work in an iframe.
   * You won't need it on your project.
   */
}

const items = [
  {
    imgSrc: Nana,
    description: 'nana_description',
    title: 'nana',
  },
];

function Contents(props: Props) {
  const classes = Styles();
  const intl = useIntl();
  return (
    <React.Fragment>
      <Carousel>
        {CAROUSEL_ITEMS.map((item) => (
          <Paper variant="outlined" square className={classes.carouselStyles}>
            <img className={classes.images} src={item.imgSrc} />
          </Paper>
        ))}
      </Carousel>
      <Grid container px={5} py={2} spacing={2}>
        {items.map((item) => (
          <Grid item md={4}>
            <Card className={classes.paperImg}>
              <CardMedia
                component="img"
                alt="Contemplative Reptile"
                height="140"
                image={item.imgSrc}
                title="Contemplative Reptile"
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  {intl.formatMessage({ id: item.title })}
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                  {intl.formatMessage({ id: item.description })}
                </Typography>
              </CardContent>
              <CardActions>
                <Button size="small">
                  {intl.formatMessage({ id: 'find_out_more' })}
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </React.Fragment>
  );
}

export default Contents;
